    return(
        <div className="geral">
        
        <Header />

        <div className="body">

            <div className="book">

                <div className="feed"><Link className="link" to="/">Homeaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa</Link></div>
                <div className="user"></div>
                <div className="bichinho"></div>

            </div>
   
        </div>

    </div>
    )
    

    
}

export default Home;
